  false,\n\t\"url\": null,\n\t\"notes\": \"This shapefile is part of a project called
  Biological Surveys at the Martin Van Buren NHS conducted by Hudsonia Ltd. Habitats
  are mapped according to methodology in Biodiversity Assessment Manual for the Hudson
  River Estuary Corridor by E. Kiviat and G. Stevens and published in 2001 by the
  NYS DEC. Preliminary habitats were mapped on 1-m accuracy orthophotos,using stereo
  pairs of ir aerials photos, and Columbia County soil maps. We field checked all
  habitat polygons and made corrections to habitat polygons as needed.\",\n\t\"license_title\":
